import React from "react";
import {
  Text,
  Flex,
  Box,
  VStack,
  HStack,
  Icon,
  Badge,
  Spacer,
  Divider,
  Pressable,
  Button,
  Center,
  Input,
} from "native-base";

import RidersCard from "../../../_shared/libs/Riders_MoneyFlow_Card";
import SendMe from "../../../assets/sendmelogo.svg";
import { Entypo, SimpleLineIcons, AntDesign } from "@expo/vector-icons";
import Svg, { Circle, Rect } from 'react-native-svg';

const Login = () => {
  return (
    <Box w="100%" flex={1} backgroundColor="#F6F5F5" px="8" pt="60px">
      <Center mt={12}>
        {/* <SendMe /> */}
      </Center>
      <Box mt={16}>
        <HStack>
          <Text fontWeight="extrabold" fontSize="bx" color="col.default">
            Sign
          </Text>
          <VStack>
            <Text
              pl="5px"
              fontWeight="extrabold"
              fontSize="bx"
              color="col.default"
            >
              Up
            </Text>
            <Divider borderRadius="4" thickness="5" bg="col.500" />
          </VStack>
        </HStack>
        <Text mt={4} fontSize="bs" color="col.greybold" lineHeight="19px">
          Confirm your details and create password
        </Text>
      </Box>

      <VStack space={10} mt={12} mb={16}>
        <Box>
          <Text
            pl="2"
            fontWeight="semibold"
            fontSize="bs"
            lineHeight="19px"
            color="col.greylight"
          >
            Full Name
          </Text>
          <Input
            type="text"
            variant="underlined"
            h={8}
            px="2"
            fontSize="lg"
            fontWeight="semibold"
            lineHeight="23px"
            color="col.default"
          />
        </Box>

        <Box>
          <Text
            pl="2"
            fontWeight="semibold"
            fontSize="bs"
            lineHeight="19px"
            color="col.greylight"
          >
            Mobile Number
          </Text>

          <Input
            type="text"
            variant="underlined"
            h={8}
            px="2"
            fontSize="lg"
            fontWeight="semibold"
            lineHeight="23px"
            color="col.default"
          />
        </Box>

        <Box>
          <Text
            pl="2"
            fontWeight="semibold"
            fontSize="bs"
            lineHeight="19px"
            color="col.greylight"
          >
            Email Address
          </Text>

          <Input
            type="email"
            variant="underlined"
            h={8}
            px="2"
            fontSize="lg"
            fontWeight="semibold"
            lineHeight="23px"
            color="col.default"
          />
        </Box>

        <Box>
          <Text
            pl="2"
            fontWeight="semibold"
            fontSize="bs"
            lineHeight="19px"
            color="col.greylight"
          >
            Create Password
          </Text>

          <Input
            type="password"
            variant="underlined"
            h={8}
            px="2"
            fontSize="lg"
            fontWeight="semibold"
            lineHeight="23px"
            color="col.default"
          />
        </Box>

        <Box>
          <Text
            pl="2"
            fontWeight="semibold"
            fontSize="bs"
            lineHeight="19px"
            color="col.greylight"
          >
            Confirm Password
          </Text>

          <Input
            type="password"
            variant="underlined"
            h={8}
            px="2"
            fontSize="lg"
            fontWeight="semibold"
            lineHeight="23px"
            color="col.default"
          />
        </Box>
      </VStack>
      <Button
        bgColor={"col.500"}
        height="56px"
        borderRadius="12px"
        _text={{
          fontWeight: "semibold",
          fontSize: "lg",
          lineHeight: "22.59px",
        }}
      >
        Done & Confirm
      </Button>
      <Svg height="50%" width="50%" viewBox="0 0 100 100" {...props}>
      <Circle cx="50" cy="50" r="45" stroke="blue" strokeWidth="2.5" fill="green" />
      <Rect x="15" y="15" width="70" height="70" stroke="red" strokeWidth="2" fill="yellow" />
    </Svg>
    </Box>
  );
};

export default Login;
